import React from 'react';

import './Button.css';

function Button( props ) {
	
	console.log( `Buscar: ${props.onclick}` );
	
	return ( 
		<button onClick={ () => {return props.onclick} }>
			<span></span><p>{ props.texto }</p>
		</button> 
	);
};

export default Button;
